const TERRARIA_AES_KEY_RAW = Uint8Array.from([0x68, 0, 0x33, 0, 0x79, 0, 0x5f, 0, 0x67, 0, 0x55, 0, 0x79, 0, 0x5a, 0]);
//                                              h [NULL] 3 [NULL] y [NULL] _ [NULL] g [NULL] U [NULL] y [NULL] Z [NULL]
(async function(){
    const key = await crypto.subtle.importKey("raw", TERRARIA_AES_KEY_RAW, "AES-CBC", true, ["encrypt", "decrypt"]);
    const aesAlgorithm = {
        name: "AES-CBC",
        iv: TERRARIA_AES_KEY_RAW
    }
    window.getPlayerBuffer = async function(encryptedData) {
        try {
            var decryptedBuffer = await crypto.subtle.decrypt(aesAlgorithm, key, Uint8Array.from(encryptedData));
            return new Uint8Array(decryptedBuffer);
        } catch(error) {
            throw {
                type: "AESDecryptError",
                error
            };
        }
    }
    window.encryptPlayer = async function(player) {
        var encryptedBuffer = await crypto.subtle.encrypt(aesAlgorithm, key, player.buffer);
        return new Uint8Array(encryptedBuffer);
    }
})();

const itemModifiers = (function(){
    const MODS = ['Large', 'Massive', 'Dangerous', 'Savage', 'Sharp', 'Pointy', 'Tiny', 'Terrible', 'Small', 'Dull', 'Unhappy', 'Bulky', 'Shameful', 'Heavy', 'Light', 'Sighted', 'Rapid', 'Hasty', 'Intimidating', 'Deadly (Ranged Weapon)', 'Staunch', 'Awful', 'Lethargic', 'Awkward', 'Powerful', 'Mystic', 'Adept', 'Masterful', 'Inept', 'Ignorant', 'Deranged', 'Intense', 'Taboo', 'Celestial', 'Furious', 'Keen', 'Superior', 'Forceful', 'Broken', 'Damaged', 'Shoddy', 'Quick (Common Weapon)', 'Deadly (Common Weapon)', 'Agile', 'Nimble', 'Murderous', 'Slow', 'Sluggish', 'Lazy', 'Annoying', 'Nasty', 'Manic', 'Hurtful', 'Strong', 'Unpleasant', 'Weak', 'Ruthless', 'Frenzying', 'Godly', 'Demonic', 'Zealous', 'Hard', 'Guarding', 'Armored', 'Warding', 'Arcane', 'Precise', 'Lucky', 'Jagged', 'Spiked', 'Angry', 'Menacing', 'Brisk', 'Fleeting', 'Hasty', 'Quick (Accessory)', 'Wild', 'Rash', 'Intrepid', 'Violent', 'Legendary', 'Unreal', 'Mythical'];
    return {
        getID(modifierName) {
            for(let i = 0; i < MODS.length; i++) {
                if(modifierName === MODS[i]) return i + 1;
            }
            return null;
        },
        getName(modifierID) {
            if(!Number.isInteger(modifierID) || modifierID === 0) return null;
            if(modifierID < 1 || modifierID > MODS.length) return "UNKNOWN (" + modifierID.toString() + ")";
            return MODS[modifierID - 1];
        },
        constructFromNBT(nbt) {
            if(nbt.has("modPrefixMod")) return nbt.get("modPrefixMod").value + ":" + nbt.get("modPrefixName").value;
            if(nbt.has("prefix")) return "Terraria:" + this.getName(nbt.get("prefix").value);
            return null;
        }
    };
})();

